剛剛結束的一場MSI，KZ 4-14不敵RNG。此役過後，KZ在MSI決賽中0-1落後KZ。賽後，KZ上路Khan接受了媒體採訪。<br />
<br />
談到是否擔心大比分0-1落後，Khan表示：&ldquo;目前階段我一點也不擔心。這又不是World Championship。系列賽過程中你會尋找方法不斷提升，我曾經0-1落後也曾經0-2落後，我經歷過季後賽中大比分落後的情況。我並不是特別擔憂，無論我今晚打得有多差，出現多少個失誤，無論我的KDA多麼低效率，無論比分0-0還是0-1落後，我進入比賽時的信心都是一樣的。我們全隊有機會在下一場表現得更好，屆時再看吧。&rdquo;
